def do_algebra(operator, operand):
    # Initialize the result with the first operand
    result = operand[0]

    # Iterate through the operators and operands
    for i in range(len(operator)):
        # Check the operator and perform the corresponding operation with the next operand
        if operator[i] == '+':
            result += operand[i+1]
        elif operator[i] == '-':
            result -= operand[i+1]
        elif operator[i] == '*':
            result *= operand[i+1]
        elif operator[i] == '//':
            result //= operand[i+1]
        elif operator[i] == '**':
            result **= operand[i+1]

    return result

import hashlib

def string_to_md5(text):
    if text == '':
        return None

    # Create an md5 hash object
    md5_hash = hashlib.md5()

    # Update the hash object with the text
    md5_hash.update(text.encode())

    # Return the hexadecimal representation of the hash
    return md5_hash.hexdigest()
